// eslint-disable-next-line import/no-anonymous-default-export
import shortid from "shortid"

export function GoodsStore(){
    return{
        goods: [],
        create(){
            this.goods.push({
                id: shortid.generate(),
                title,
                quantity,
                isOver: false
            })
        },
        deleteTodo(goodItem){
            this.goods.remove(goodItem)
        }
    }
}
